import React from "react";
import log from "./log";
const logArea = ()=>{

    return(
        <div className = "logDetails">


            <div className = "logHeading">
                <div><span><b>Date</b></span></div>
                <div><span><b>IN Time</b></span></div>
                <div><span><b>OUT Time</b></span></div>
            </div>
            <log></log>


        </div>
    )
}

export default logArea;
